import React, { Component } from 'react'

import "./SmCard.css";

class SmCard extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="SmCard">
        <div className="SmCard-content">
          <div>{this.props.name}</div>

        </div>

      </div>
    );
  }
}

export default SmCard;
